import React, { useState } from 'react';

function Losowanie2() {
  const [numbers, setNumbers] = useState([0, 0, 0]);

  const generateNumbers = () => {
    const newNumbers = Array(3).fill(0).map(() => Math.floor(Math.random() * 10)); // Generate 3 random numbers
    setNumbers(newNumbers);
  }

  return (
    <div>
      <div>{numbers[0]} {numbers[1]} {numbers[2]}</div>
      <button onClick={generateNumbers}>Spin</button>
    </div>
  );
}

export default Losowanie2;
